import React from 'react';
import Svg from '../elements/Svg';
import { AstProps } from "./common";

export function SvgAst({ ast, override }: AstProps) {
    if (!ast) {
        return null;
    }
    const { props, children } = ast;
    return (
        <Svg {...props} {...override}>
            {children}
        </Svg>
    );
}

export default SvgAst;